module and_gate_masked(
    input a0,
    input a1,
    input b0,
    input b1,
    input rN,
    output y0,
    output y1
);

wire p00, p01, p10, p11;

assign p00 = a0 & b0;
assign p01 = a0 & b1;
assign p10 = a1 & b0;
assign p11 = a1 & b1;

assign y0 = p00 ^ p01 ^ rN;
assign y1 = p11 ^ p10 ^ rN;

endmodule
